import React from "react";
import GaugeChart from 'react-advanced-gauge-chart'

export default class Displaying extends React.Component {
  constructor(props) {
    super(props);
    let sensordata = props.sensor.sensordata;
    return (
      <tr>
      <th scope="row">{props.sensor.sensorid}</th>
      <td>{props.sensor.sensorname}</td>
      <td>{props.sensor.sensordata}</td>
      <td>
      <div class="progress">
        <div class="progress-bar" role="progressbar" aria-valuenow={sensordata}
            aria-valuemin="0" aria-valuemax="100" style={{width:`${sensordata}%`}}>
            {sensordata} %
        </div>
      </div>        
      </td>
      <td>
      <GaugeChart id="gauge-chart2"
percent={0.86}
previousValue={0.75}
/>
      </td>
    </tr>
    );

  }
}
